@testset "3.2.3 u log(e (f (a+b x)^p (c+d x)^q)^r)^s" begin
    (A, B, a, b, c, d, e, f, g, h, i, j, k, m, n, p, q, r, s, t, u, x, ) = @variables A B a b c d e f g h i j k m n p q r s t u x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*u*(A+B*log(e*((a+b*x)/(c+d*x))^n))^p=#


    #= ::Section::Closed:: =#
