    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(f+g/x)^m*(A+B*log(e*((a+b*x)/(c+d*x))^n))^p=#


    @test_int [(f + g/x)^3*(A + B*log(e*((a + b*x)/(c + d*x))^n)), x, 16, -((B*(b*c - a*d)*g^3*n)/(2*a*c*x)) + A*f^3*x - (1/2)*B*(b^2/a^2 - d^2/c^2)*g^3*n*log(x) + (b^2*B*g^3*n*log(a + b*x))/(2*a^2) - 3*B*f^2*g*n*log(x)*log(1 + (b*x)/a) + (B*f^3*(a + b*x)*log(e*((a + b*x)/(c + d*x))^n))/b - (g^3*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(2*x^2) + (3*(b*c - a*d)*f*g^2*(a + b*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(a*(c + d*x)*(a - (c*(a + b*x))/(c + d*x))) + 3*f^2*g*log(x)*(A + B*log(e*((a + b*x)/(c + d*x))^n)) - (B*(b*c - a*d)*f^3*n*log(c + d*x))/(b*d) - (B*d^2*g^3*n*log(c + d*x))/(2*c^2) + 3*B*f^2*g*n*log(x)*log(1 + (d*x)/c) + (3*B*(b*c - a*d)*f*g^2*n*log(a - (c*(a + b*x))/(c + d*x)))/(a*c) - 3*B*f^2*g*n*PolyLog(2, -((b*x)/a)) + 3*B*f^2*g*n*PolyLog(2, -((d*x)/c))]
    @test_int [(f + g/x)^2*(A + B*log(e*((a + b*x)/(c + d*x))^n)), x, 13, A*f^2*x - 2*B*f*g*n*log(x)*log(1 + (b*x)/a) + (B*f^2*(a + b*x)*log(e*((a + b*x)/(c + d*x))^n))/b + ((b*c - a*d)*g^2*(a + b*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(a*(c + d*x)*(a - (c*(a + b*x))/(c + d*x))) + 2*f*g*log(x)*(A + B*log(e*((a + b*x)/(c + d*x))^n)) - (B*(b*c - a*d)*f^2*n*log(c + d*x))/(b*d) + 2*B*f*g*n*log(x)*log(1 + (d*x)/c) + (B*(b*c - a*d)*g^2*n*log(a - (c*(a + b*x))/(c + d*x)))/(a*c) - 2*B*f*g*n*PolyLog(2, -((b*x)/a)) + 2*B*f*g*n*PolyLog(2, -((d*x)/c))]
    @test_int [(f + g/x)^1*(A + B*log(e*((a + b*x)/(c + d*x))^n)), x, 10, A*f*x - B*g*n*log(x)*log(1 + (b*x)/a) + (B*f*(a + b*x)*log(e*((a + b*x)/(c + d*x))^n))/b + g*log(x)*(A + B*log(e*((a + b*x)/(c + d*x))^n)) - (B*(b*c - a*d)*f*n*log(c + d*x))/(b*d) + B*g*n*log(x)*log(1 + (d*x)/c) - B*g*n*PolyLog(2, -((b*x)/a)) + B*g*n*PolyLog(2, -((d*x)/c))]
    @test_int [(A + B*log(e*((a + b*x)/(c + d*x))^n))/(f + g/x)^1, x, 12, (A*x)/f + (B*(a + b*x)*log(e*((a + b*x)/(c + d*x))^n))/(b*f) - (B*(b*c - a*d)*n*log(c + d*x))/(b*d*f) + (B*g*n*log((f*(a + b*x))/(a*f - b*g))*log(g + f*x))/f^2 - (g*(A + B*log(e*((a + b*x)/(c + d*x))^n))*log(g + f*x))/f^2 - (B*g*n*log((f*(c + d*x))/(c*f - d*g))*log(g + f*x))/f^2 + (B*g*n*PolyLog(2, -((b*(g + f*x))/(a*f - b*g))))/f^2 - (B*g*n*PolyLog(2, -((d*(g + f*x))/(c*f - d*g))))/f^2]
    @test_int [(A + B*log(e*((a + b*x)/(c + d*x))^n))/(f + g/x)^2, x, 15, (A*x)/f^2 + (B*(a + b*x)*log(e*((a + b*x)/(c + d*x))^n))/(b*f^2) - (g^2*(a + b*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(f^2*(a*f - b*g)*(g + f*x)) - (B*(b*c - a*d)*n*log(c + d*x))/(b*d*f^2) + (2*B*g*n*log((f*(a + b*x))/(a*f - b*g))*log(g + f*x))/f^3 - (2*g*(A + B*log(e*((a + b*x)/(c + d*x))^n))*log(g + f*x))/f^3 - (2*B*g*n*log((f*(c + d*x))/(c*f - d*g))*log(g + f*x))/f^3 + (B*(b*c - a*d)*g^2*n*log((g + f*x)/(c + d*x)))/(f^2*(a*f - b*g)*(c*f - d*g)) + (2*B*g*n*PolyLog(2, -((b*(g + f*x))/(a*f - b*g))))/f^3 - (2*B*g*n*PolyLog(2, -((d*(g + f*x))/(c*f - d*g))))/f^3]
    @test_int [(A + B*log(e*((a + b*x)/(c + d*x))^n))/(f + g/x)^3, x, 18, (A*x)/f^3 + (B*(b*c - a*d)*g^3*n)/(2*f^3*(a*f - b*g)*(c*f - d*g)*(g + f*x)) - (b^2*B*g^3*n*log(a + b*x))/(2*f^4*(a*f - b*g)^2) + (B*(a + b*x)*log(e*((a + b*x)/(c + d*x))^n))/(b*f^3) + (g^3*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(2*f^4*(g + f*x)^2) - (3*g^2*(a + b*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(f^3*(a*f - b*g)*(g + f*x)) - (B*(b*c - a*d)*n*log(c + d*x))/(b*d*f^3) + (B*d^2*g^3*n*log(c + d*x))/(2*f^4*(c*f - d*g)^2) + (B*(b*c - a*d)*g^3*(b*c*f + a*d*f - 2*b*d*g)*n*log(g + f*x))/(2*f^3*(a*f - b*g)^2*(c*f - d*g)^2) + (3*B*g*n*log((f*(a + b*x))/(a*f - b*g))*log(g + f*x))/f^4 - (3*g*(A + B*log(e*((a + b*x)/(c + d*x))^n))*log(g + f*x))/f^4 - (3*B*g*n*log((f*(c + d*x))/(c*f - d*g))*log(g + f*x))/f^4 + (3*B*(b*c - a*d)*g^2*n*log((g + f*x)/(c + d*x)))/(f^3*(a*f - b*g)*(c*f - d*g)) + (3*B*g*n*PolyLog(2, -((b*(g + f*x))/(a*f - b*g))))/f^4 - (3*B*g*n*PolyLog(2, -((d*(g + f*x))/(c*f - d*g))))/f^4]


    #= ::Title:: =#
    #=Integrands*of*the*form*u*(A+B*log(e*(f*(a+b*x)^s*(c+d*x)^t)^n))^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(g+h*x)^m*(A+B*log(e*(f*(a+b*x)^s*(c+d*x)^t)^n))^p=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(g+h*x)^m*(A+B*log(e*(f*(a+b*x)^s*(c+d*x)^t)^n))^p*when*b*g-a*h=0=#


    @test_int [log(e*(f*(a + b*x)^p*(c + d*x)^q)^r)*(a + b*x)^4, x, 4, -(((b*c - a*d)^4*q*r*x)/(5*d^4)) + ((b*c - a*d)^3*q*r*(a + b*x)^2)/(10*b*d^3) - ((b*c - a*d)^2*q*r*(a + b*x)^3)/(15*b*d^2) + ((b*c - a*d)*q*r*(a + b*x)^4)/(20*b*d) - (p*r*(a + b*x)^5)/(25*b) - (q*r*(a + b*x)^5)/(25*b) + ((b*c - a*d)^5*q*r*log(c + d*x))/(5*b*d^5) + ((a + b*x)^5*log(e*(f*(a + b*x)^p*(c + d*x)^q)^r))/(5*b)]
