    @test_int [log(e*(f*(a + b*x)^p*(c + d*x)^q)^r)*(a + b*x)^2, x, 4, -(((b*c - a*d)^2*q*r*x)/(3*d^2)) + ((b*c - a*d)*q*r*(a + b*x)^2)/(6*b*d) - (p*r*(a + b*x)^3)/(9*b) - (q*r*(a + b*x)^3)/(9*b) + ((b*c - a*d)^3*q*r*log(c + d*x))/(3*b*d^3) + ((a + b*x)^3*log(e*(f*(a + b*x)^p*(c + d*x)^q)^r))/(3*b)]
    @test_int [log(e*(f*(a + b*x)^p*(c + d*x)^q)^r)*(a + b*x)^1, x, 4, (-(1/2))*a*p*r*x + ((b*c - a*d)*q*r*x)/(2*d) - (1/4)*b*p*r*x^2 - (q*r*(a + b*x)^2)/(4*b) - ((b*c - a*d)^2*q*r*log(c + d*x))/(2*b*d^2) + ((a + b*x)^2*log(e*(f*(a + b*x)^p*(c + d*x)^q)^r))/(2*b)]
