    @test_int [log(e*(f*(a + b*x)^p*(c + d*x)^q)^r)/(a + b*x)^2, x, 5, -((p*r)/(b*(a + b*x))) + (d*q*r*log(a + b*x))/(b*(b*c - a*d)) - (d*q*r*log(c + d*x))/(b*(b*c - a*d)) - log(e*(f*(a + b*x)^p*(c + d*x)^q)^r)/(b*(a + b*x))]
