    @test_int [log(e*(f*(a + b*x)^p*(c + d*x)^q)^r)/(a + b*x)^4, x, 4, -((p*r)/(9*b*(a + b*x)^3)) - (d*q*r)/(6*b*(b*c - a*d)*(a + b*x)^2) + (d^2*q*r)/(3*b*(b*c - a*d)^2*(a + b*x)) + (d^3*q*r*log(a + b*x))/(3*b*(b*c - a*d)^3) - (d^3*q*r*log(c + d*x))/(3*b*(b*c - a*d)^3) - log(e*(f*(a + b*x)^p*(c + d*x)^q)^r)/(3*b*(a + b*x)^3)]
    @test_int [log(e*(f*(a + b*x)^p*(c + d*x)^q)^r)/(a + b*x)^5, x, 4, -((p*r)/(16*b*(a + b*x)^4)) - (d*q*r)/(12*b*(b*c - a*d)*(a + b*x)^3) + (d^2*q*r)/(8*b*(b*c - a*d)^2*(a + b*x)^2) - (d^3*q*r)/(4*b*(b*c - a*d)^3*(a + b*x)) - (d^4*q*r*log(a + b*x))/(4*b*(b*c - a*d)^4) + (d^4*q*r*log(c + d*x))/(4*b*(b*c - a*d)^4) - log(e*(f*(a + b*x)^p*(c + d*x)^q)^r)/(4*b*(a + b*x)^4)]


    @test_int [log(e*(f*(a + b*x)^p*(c + d*x)^q)^r)^2*(a + b*x)^4, x, 32, -((a*(b*c - a*d)^3*p*q*r^2*x)/(5*d^3)) + (2*(b*c - a*d)^4*p*q*r^2*x)/(25*d^4) + (77*(b*c - a*d)^4*q^2*r^2*x)/(150*d^4) + (2*(b*c - a*d)^4*q*(p + q)*r^2*x)/(5*d^4) - (b*(b*c - a*d)^3*p*q*r^2*x^2)/(10*d^3) - ((b*c - a*d)^3*p*q*r^2*(a + b*x)^2)/(25*b*d^3) - (77*(b*c - a*d)^3*q^2*r^2*(a + b*x)^2)/(300*b*d^3) + (16*(b*c - a*d)^2*p*q*r^2*(a + b*x)^3)/(225*b*d^2) + (47*(b*c - a*d)^2*q^2*r^2*(a + b*x)^3)/(450*b*d^2) - (9*(b*c - a*d)*p*q*r^2*(a + b*x)^4)/(200*b*d) - (9*(b*c - a*d)*q^2*r^2*(a + b*x)^4)/(200*b*d) + (2*p^2*r^2*(a + b*x)^5)/(125*b) + (4*p*q*r^2*(a + b*x)^5)/(125*b) + (2*q^2*r^2*(a + b*x)^5)/(125*b) - (2*(b*c - a*d)^5*p*q*r^2*log(c + d*x))/(25*b*d^5) - (137*(b*c - a*d)^5*q^2*r^2*log(c + d*x))/(150*b*d^5) - (2*(b*c - a*d)^5*p*q*r^2*log(-((d*(a + b*x))/(b*c - a*d)))*log(c + d*x))/(5*b*d^5) - ((b*c - a*d)^5*q^2*r^2*log(c + d*x)^2)/(5*b*d^5) - (2*(b*c - a*d)^4*q*r*(a + b*x)*log(e*(f*(a + b*x)^p*(c + d*x)^q)^r))/(5*b*d^4) + ((b*c - a*d)^3*q*r*(a + b*x)^2*log(e*(f*(a + b*x)^p*(c + d*x)^q)^r))/(5*b*d^3) - (2*(b*c - a*d)^2*q*r*(a + b*x)^3*log(e*(f*(a + b*x)^p*(c + d*x)^q)^r))/(15*b*d^2) + ((b*c - a*d)*q*r*(a + b*x)^4*log(e*(f*(a + b*x)^p*(c + d*x)^q)^r))/(10*b*d) - (2*p*r*(a + b*x)^5*log(e*(f*(a + b*x)^p*(c + d*x)^q)^r))/(25*b) - (2*q*r*(a + b*x)^5*log(e*(f*(a + b*x)^p*(c + d*x)^q)^r))/(25*b) + (2*(b*c - a*d)^5*q*r*log(c + d*x)*log(e*(f*(a + b*x)^p*(c + d*x)^q)^r))/(5*b*d^5) + ((a + b*x)^5*log(e*(f*(a + b*x)^p*(c + d*x)^q)^r)^2)/(5*b) - (2*(b*c - a*d)^5*p*q*r^2*PolyLog(2, (b*(c + d*x))/(b*c - a*d)))/(5*b*d^5)]
